import ParkList from "./ParkList";

const Navbar = () => {
    return (
        <nav className="navbar">
            <h1>U.S. National Parks</h1>
            <div className="links">
                <a href="/">Home</a>
                <a href="/Parks">Parks <button onClickPark={() => {
                    ParkList.setState({visible: true});
                    }} ></button></a>
                <a href="/Activities">Activities <button onClickActivities={() => {
                    ParkList.setState({visible: false});
                    }} /></a>
                <a href="/Webcams">Webcams <button onClickWebcams={() => {
                    ParkList.setState({visible: false});
                    }} ></button></a>
            </div>
        </nav>
    );
}

export default Navbar;
